import React from 'react';

export default function ActionLink(props) {
    
    
    function handleClick(e) {
      e.preventDefault();
      console.log('The link was clicked.');
    }
  
    return (
      <a href="#" onClick={handleClick}>
        {props.key}
          {/* {props.product.fields[props.key][0]} */}
      </a>
    );
  }
